      "text": "<p>Dziś była tak wartka dyskusja o rapi, że postanowiłem skonstruować sobie do niego chłodzenie.<br>\nNa początek trzeba wybrać jakiś nadający się radiator - <a href=\"https://i.imgur.com/lYA4Ukz.jpg\" rel=\"nofollow\" class=\"image\">ten wyjęty ze starego CPU będzie chyba ok</a><br>\nNależy na swój sposób wymierzyć jak ów radiator przyciąć, ja zamiast uruchamiać dokumentację płytki postawiłem na swoje oko i <a href=\"https://i.imgur.com/D49vHXu.jpg\" rel=\"nofollow\" class=\"image\">oznaczyłem ołówkiem miejsca cięć</a><br>\nDo cięcia metalu polecam użyć czegokolwiek przeznaczonego do cięcia metalu, nożyce kuchenne mogą mieć z tym problem, tym bardziej twoje nożyczki szkolne, klej też schowaj do plecaka. <a href=\"https://i.imgur.com/QVG8qlA.jpg\" rel=\"nofollow\" class=\"image\">nieco przycięty radiator</a><br>\nOstatnie cięcia i już można nakładać pastę termoprzewodzącą <a href=\"https://i.imgur.com/2HU0QRV.jpg\" rel=\"nofollow\" class=\"image\">zalman dwa tysiące na układy scalone</a><br>\nNo dobrze, a co z mocowaniem? Ja postawiłem na ostatni krzyk mody - <a href=\"https://i.imgur.com/4wXPhXj.jpg\" rel=\"nofollow\" class=\"image\">kolorowe kable stabilizacyjno usztywniające</a> - odziwo mocowanie jest bardzo sztywne i radiator trzyma się scalaków pewnie jak nietoperz za gałąź.</p>\n<p>Dzięki tym czynnością, z nowym chłodzeniem pasywnym dwa tysiące mogę na poważnie zająć się overclockingiem. W przyszłości być może rozbuduje je o blok chłodzenia wodnego. </p>",
